member.remarks:
Below is the JSON schema for the request and response payloads.
Request Body:
Schema for Test: { passFailCriteria: { passFailMetrics: Dictionary<string, PassFailMetric>, # Optional. Map of id and pass fail metrics { id : pass fail metrics }. }, # Optional. Pass fail criteria for a test. secrets: Dictionary<string, Secret>, # Optional. Secrets can be stored in an Azure Key Vault or any other secret store. If the secret is stored in an Azure Key Vault, the value should be the secret identifier and the type should be AKV_SECRET_URI. If the secret is stored elsewhere, the secret value should be provided directly and the type should be SECRET_VALUE. certificate: { value: string, # Optional. The value of the certificate for respective type type: "AKV_CERT_URI", # Optional. Type of certificate name: string, # Optional. Name of the certificate. }, # Optional. Certificates metadata environmentVariables: Dictionary<string, string>, # Optional. Environment variables which are defined as a set of <name,value> pairs. loadTestConfiguration: { engineInstances: number, # Optional. The number of engine instances to execute load test. Supported values are in range of 1-45. Required for creating a new test. splitAllCSVs: boolean, # Optional. If false, Azure Load Testing copies and processes your input files unmodified across all test engine instances. If true, Azure Load Testing splits the CSV input data evenly across all engine instances. If you provide multiple CSV files, each file will be split evenly. quickStartTest: boolean, # Optional. If true, optionalLoadTestConfig is required and JMX script for the load test is not required to upload. optionalLoadTestConfig: { endpointUrl: string, # Optional. Test URL. Provide the complete HTTP URL. For example, http://contoso-app.azurewebsites.net/login virtualUsers: number, # Optional. No of concurrent virtual users rampUpTime: number, # Optional. Ramp up time duration: number, # Optional. Test run duration }, # Optional. Optional load test config }, # Optional. The load test configuration. inputArtifacts: { configFileInfo: { url: string, # Optional. File URL. fileName: string, # Optional. Name of the file. fileType: "JMX_FILE" | "USER_PROPERTIES" | "ADDITIONAL_ARTIFACTS", # Optional. File type expireDateTime: string (ISO 8601 Format), # Optional. Expiry time of the file (ISO 8601 literal format) validationStatus: "NOT_VALIDATED" | "VALIDATION_SUCCESS" | "VALIDATION_FAILURE" | "VALIDATION_INITIATED" | "VALIDATION_NOT_REQUIRED", # Optional. Validation status of the file validationFailureDetails: string, # Optional. Validation failure error details }, # Optional. File info testScriptFileInfo: FileInfo, # Optional. File info userPropFileInfo: FileInfo, # Optional. File info inputArtifactsZipFileInfo: FileInfo, # Optional. File info additionalFileInfo: [FileInfo], # Optional. Additional supported files for the test run }, # Optional. The input artifacts for the test. testId: string, # Optional. Unique test name as identifier. description: string, # Optional. The test description. displayName: string, # Optional. Display name of a test. subnetId: string, # Optional. Subnet ID on which the load test instances should run. keyvaultReferenceIdentityType: string, # Optional. Type of the managed identity referencing the Key vault. keyvaultReferenceIdentityId: string, # Optional. Resource Id of the managed identity referencing the Key vault. createdDateTime: string (ISO 8601 Format), # Optional. The creation datetime(ISO 8601 literal format). createdBy: string, # Optional. The user that created. lastModifiedDateTime: string (ISO 8601 Format), # Optional. The last Modified datetime(ISO 8601 literal format). lastModifiedBy: string, # Optional. The user that last modified. }
